// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface ERC20 {
    /*
     *    
     */
    function totalSupply() external view returns (uint256);

    /*
     *    
     */
    function balanceOf(address _owner) external view returns (uint256);

    /*
     *   ( )
     */
    function transfer(address _to, uint256 _value)
        external
        payable
        returns (bool);

    /*
     *   (  )
     */
    function transferFrom(
        address _from,
        address _to,
        uint256 _value
    ) external returns (bool);

    /*
     *         
     */
    function approve(address _spender, uint256 _value) external returns (bool);

    /*
     *     
     */
    function allowance(address _owner, address _spender)
        external
        view
        returns (uint256);

    /*
     *       
     *     
     */
    event Transfer(address _from, address _to, uint256 _value);
    event Approval(address _from, address _to, uint256 _value);
}

contract StandardToken is ERC20 {
    mapping(address => uint256) balances;
    mapping(address => mapping(address => uint256)) allowed;

    function totalSupply() external view override returns (uint256) {}

    function balanceOf(address _owner)
        external
        view
        override
        returns (uint256)
    {
        return balances[_owner];
    }

    function transfer(address _to, uint256 _value)
        external
        payable
        override
        returns (bool)
    {
        if (balances[msg.sender] >= _value && _value > 0) {
            balances[msg.sender] -= _value;
            balances[_to] += _value;
            emit Transfer(msg.sender, _to, _value);
            return true;
        } else {
            return false;
        }
    }

    function transferFrom(
        address _from,
        address _to,
        uint256 _value
    ) external override returns (bool) {
        if (balances[_from] >= _value && _value > 0) {
            balances[msg.sender] -= _value;
            balances[_to] += _value;
            allowed[_from][_to] -= _value;
            emit Transfer(_from, _to, _value);
            return true;
        } else {
            return false;
        }
    }

    function approve(address _spender, uint256 _value)
        external
        override
        returns (bool)
    {
        allowed[msg.sender][_spender] = _value;
        emit Approval(msg.sender, _spender, _value);
        return true;
    }

    function allowance(address _owner, address _spender)
        external
        view
        override
        returns (uint256)
    {
        return allowed[_owner][_spender];
    }
}

contract Cultural is StandardToken {
    string public name; //token name
    uint8 public decimals; //(18)to using wei
    string public symbol; //unit of Token
    string public version; //   (1.0.0)
    uint256 public unitOneEthCanBuy; //1ETH     
    uint256 public totalEthInWei; //   
    address public fundWallet; //ETH   

    constructor() payable {
        name = "CuturalToken";
        decimals = 18;
        symbol = "CUR";
        unitOneEthCanBuy = 100;
        fundWallet = msg.sender; //  
        balances[msg.sender] = 10000000000000000000000;
    }

    fallback() external payable {
        totalEthInWei = totalEthInWei + msg.value;
        uint256 amount = msg.value * unitOneEthCanBuy;
        require(balances[fundWallet] >= amount);

        balances[fundWallet] -= amount;
        balances[msg.sender] += amount;

        emit Transfer(fundWallet, msg.sender, amount);

        payable(fundWallet).transfer(msg.value);
    }

    function approveAndCall(
        address _spender,
        uint256 _value,
        bytes memory _extraData
    ) public returns (bool) {
        allowed[msg.sender][_spender] = _value;
        emit Approval(msg.sender, _spender, _value);

        (bool success, bytes memory Data) = _spender.call(
            abi.encodeWithSignature(
                "receiveApproval(address,uint256,address,bytes)",
                msg.sender,
                _value,
                address(this),
                _extraData
            )
        ); //  .

        require(success, "call failed");
        return true;
    }
}
